import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col, Row, Container } from 'react-bootstrap';

function App() {
  return (
      <Container className="row">
        <Row>
          <Col className="col-grey" sm={3}>sm=3</Col>
          <Col className="col-rice" sm={3}>sm=3</Col>
          <Col className="col-grey" sm={3}>sm=3</Col>
        </Row>
        <Row></Row>
      </Container>
  );
}

export default App;
